import { useState } from 'react';
import {
  Button,
  Col,
  Container,
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from 'reactstrap';
import { registerUser } from '../lib/auth';

const register = () => {
  const [data, setData] = useState({ username: '', email: '', password: '' });

  const handleRegister = () => {
    registerUser();
  };

  return (
    <Container>
      <Row>
        <Col>
          <div className="paper">
            <div className="header">
              <h2>ユーザー登録</h2>
            </div>
          </div>
          <section className="wrapper">
            <Form>
              <fieldset>
                <FormGroup>
                  <Label>ユーザー名 : </Label>
                  <Input
                    type="text"
                    name="username"
                    style={{ height: 50, fontSize: '1.2rem' }}
                    onChange={(e) => {
                      setData({ ...data, username: e.target.value });
                    }}
                  />
                </FormGroup>
                <FormGroup>
                  <Label>メールアドレス : </Label>
                  <Input
                    type="email"
                    name="email"
                    style={{ height: 50, fontSize: '1.2rem' }}
                    onChange={(e) => {
                      setData({ ...data, email: e.target.value });
                    }}
                  />
                </FormGroup>
                <FormGroup>
                  <Label>パスワード : </Label>
                  <Input
                    type="password"
                    name="password"
                    style={{ height: 50, fontSize: '1.2rem' }}
                    onChange={(e) => {
                      setData({ ...data, password: e.target.value });
                    }}
                  />
                </FormGroup>
                <span>
                  <a href="">
                    <small>パスワードをお忘れですか</small>
                  </a>
                </span>
                <Button
                  style={{ float: 'right', width: 120 }}
                  color="primary"
                  onClick={() => {
                    handleRegister;
                  }}
                >
                  登録
                </Button>
              </fieldset>
            </Form>
          </section>
        </Col>
      </Row>

      <style jsx>
        {`
          .paper {
            text-align: center;
            margin-top: 50px;
          }
          .header {
            widht: 100%;
            margin-bottom: 30px;
          }
          .wrapper {
            padding: 10px 30px 20px 30px;
          }
        `}
      </style>
    </Container>
  );
};

export default register;
